const Navigation = ({onRouteChange1}) => {
    return(
        <nav style = {{display:'flex',justifyContent:'flex-end'}}>
            <p onClick = {onRouteChange1} className = 'f3 link dim black underline pa3 ponter'>Sign Out</p>
        </nav>
    )
}
export default Navigation;
